import React from 'react';
import { NavLink } from 'react-router-dom';

// styled-components imports
import styled from 'styled-components';
import Theme from '../theme';

// MaterialUI
import { makeStyles } from '@material-ui/core/styles';

const StyledNavBar = styled.div `
  // flex-grow: 1;
  width: 100%;
  position: fixed;
  z-index: 3;
  background-color: ${props => `${props.theme.colors.transparent}`};

  #f-AppBar {
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding: 1em;
    font-family: ${props => `${props.theme.fonts.raleway}`};

    .f-LogoText {
      color: ${props => `${props.theme.colors.light}`};
      margin-left: 1em;
      background-color: ${props => `${props.theme.colors.dark}`};
      padding: .5em;

      &:hover {
        text-decoration: none;
      }
    }

    #f-Toolbar {
      padding: 2em;
      text-align: right;

      .f-AppBarLinks {
        color: ${props => `${props.theme.colors.light}`};
        background-color: ${props => `${props.theme.colors.dark}`};
        text-decoration: none;
        padding: .5em;
        // margin: 0 1em;
      }
    }
  }
`

// MaterialUI makeStyles
const useStyles = makeStyles((theme) => ({
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

export default function NavigationBar() {
  const classes = useStyles();

  return (
    <Theme>
      <StyledNavBar>
        <div id="f-AppBar">
          {/* <h1 className="f-LogoText">nell hensey</h1> */}
          <NavLink className="f-LogoText" activeClassName="is-active" to="/">nell hensey</NavLink>
            <div id="f-Toolbar">
              {/* <NavLink className="f-AppBarLinks" activeClassName="is-active" to="/">
                  home
              </NavLink> */}
              <NavLink className="f-AppBarLinks" activeClassName="is-active" to="/works">
                  works
              </NavLink>
              <NavLink className="f-AppBarLinks" activeClassName="is-active" to="/about">
                  bio
              </NavLink>
          </div>
        </div>
      </StyledNavBar>
    </Theme>
  );
}
